import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { AnimatePresence } from 'framer-motion';
import Login from './components/auth/Login';
import Register from './components/auth/Register';
import Dashboard from './components/dashboard/Dashboard';
import LandingPage from './components/landing/LandingPage';
import Header from './components/common/Header';
import { ThemeProvider } from './context/ThemeContext';
import { AuthProvider } from './context/AuthContext';

const Placeholder = ({ title }) => (
  <div className="min-h-[60vh] flex flex-col items-center justify-center">
    <h1 className="text-4xl font-bold text-blue-900 mb-4">{title}</h1>
    <p className="text-lg text-blue-700">This page is under construction.</p>
  </div>
);

function App() {
  return (
    <ThemeProvider>
      <AuthProvider>
        <Router>
          <Header />
          <AnimatePresence mode="wait">
            <Routes>
              <Route path="/" element={<LandingPage />} />
              <Route path="/login" element={<Login />} />
              <Route path="/register" element={<Register />} />
              <Route path="/dashboard/*" element={<Dashboard />} />
              <Route path="/learn" element={<Placeholder title="Learn" />} />
              <Route path="/practice" element={<Placeholder title="Practice" />} />
              <Route path="/compete" element={<Placeholder title="Compete" />} />
              <Route path="/mentorship" element={<Placeholder title="Mentorship" />} />
              <Route path="/jobs" element={<Placeholder title="Jobs" />} />
              <Route path="/blogs" element={<Placeholder title="Blogs" />} />
              <Route path="/host" element={<Placeholder title="Host an Opportunity" />} />
              <Route path="*" element={<Navigate to="/" replace />} />
            </Routes>
          </AnimatePresence>
        </Router>
      </AuthProvider>
    </ThemeProvider>
  );
}

export default App;
